import React from 'react'
import Navbaar from './Navbaar'
import Header from './Header'
import Service from './Service'
import Footer from './Footer'

function services() {
  return (
    <>
      <Navbaar/>
      <Header />
      <Service />
      <Footer />
    </>
  )
}

export default services;
